go
create function Free_Running.calcula_fecha_vencimiento(@fecha smalldatetime)
returns smalldatetime
as 
begin
declare @fecha_final smalldatetime
set @fecha_final = DATEADD(DAY,60,@fecha)
return @fecha_final
end
go








