--cursor que hace un Update en agenda
go
Create Trigger T_TurnoAgendaInser on Free_Running.Turno
after insert
as
begin
Declare @fecha datetime, @medico numeric(18,0),@turno numeric(18,0)
DECLARE updateAgenda CURSOR 
FOR (select i.Fecha, i.Medico_Id, i.Numero  from inserted i)
OPEN updateAgenda
FETCH updateAgenda INTO @fecha, @medico, @turno
WHILE (@@FETCH_STATUS = 0)
BEGIN
	Update Free_Running.Agenda set Turno_Id = @turno where FechaHora_Turno = @fecha and Medico = @medico
	FETCH updateAgenda INTO @fecha, @medico, @turno
END 
CLOSE updateAgenda
DEALLOCATE updateAgenda

end
go


Create Trigger T_TurnoCancelado on Free_Running.Turno_Cancelado
after insert
as
--cursor que pone Null en agenda el campo Turno Id
begin
	Declare @turno numeric(18,0),@cancelado_por varchar(255)
	DECLARE updateAgendaTC CURSOR 
	FOR (select i.Turno_Numero, i.Cancelado_Por from inserted i)
	OPEN updateAgendaTC
	FETCH updateAgendaTC INTO @turno, @cancelado_por
	WHILE (@@FETCH_STATUS = 0)
	BEGIN
		if(@cancelado_por = 'Paciente')
		begin
			Update Free_Running.Agenda set Turno_Id = NULL where Turno_Id = @turno
		end
	FETCH updateAgendaTC INTO @turno, @cancelado_por
	
	END 
	CLOSE updateAgendaTC
	DEALLOCATE updateAgendaTC
end
go


